import { createWebHistory, createRouter } from 'vue-router'
import PokemonList from './views/PokemonList.vue'
import PokemonDetail from './views/PokemonDetail.vue'

createRouter({
    mode: 'history',
    routes: [
        {
            path: '/pokemon',
            name: 'pokemon-list',
            component: PokemonList
        },
        {
            path: '/pokemon/:id',
            name: 'pokemon-detail',
            component: PokemonDetail,
            props: true
        }
    ]
})
